import React from 'react';
import '../../styles/Services/TopSection.css'; // Create this CSS file

const TopSection = () => {
    return (
        <header className="top-section">
            <h1 className="top-title">Social Event Management Services</h1>
        </header>
    );
};

export default TopSection;
